con:config.script:
import com.eviware.soapui.support.UISupport;
import groovy.util.slurpersupport.GPathResult;
import org.xml.sax.*;
import com.eviware.soapui.support.types.*;
import com.eviware.soapui.model.testsuite.*;

int currentStepInd = context.currentStepIndex
TestCase testcase = testRunner.testCase;
TestStep listOfContinentsByCodeStep = testcase.getTestStepAt(currentStepInd - 1);
Random randomContinent = new Random();

String resultMessage = '';

try{
  String listOfContinentsByCodeResponseHdrCt = listOfContinentsByCodeStep.testRequest.getResponse().getContentType();

  if (listOfContinentsByCodeResponseHdrCt.contains("xml")) {
  	String listOfContinentsByCodeResponse = listOfContinentsByCodeStep.testRequest.getResponse().getContentAsXml();

     GPathResult XMLPResponseEnv = new groovy.util.XmlSlurper().parseText(listOfContinentsByCodeResponse);

  	XMLPResponseEnv.declareNamespace(soap: 'http://schemas.xmlsoap.org/wsdl/soap/')
  	               .declareNamespace(soapenv: 'http://www.w3.org/2003/05/soap-envelope')
  	               .declareNamespace(websamci: 'http://www.oorsprong.org/websamples.countryinfo');

     List<String> continentcodes = new ArrayList<String>();
     List<String> continentvalues = new ArrayList<String>();

     // Get all continents
     XMLPResponseEnv.'soapenv:Body'.'websamci:ListOfContinentsByCodeResponse'.'websamci:ListOfContinentsByCodeResult'.'websamci:tContinent'.each{
     	continentcodes.add(it."websamci:sCode".text());
          continentvalues.add(it."websamci:sName".text());
     }

     def selectedContinent = "";

     // The LoadTestRunner indicates if the testcase is run during a load test.
     if (context.LoadTestRunner == null) {
     	// Ask the question
     	selectedContinent = UISupport.prompt("Select continent", "Continent", continentvalues);
     } else {
     	// Random get a continent value from the result
     	selectedContinent = continentvalues.get(randomContinent.nextInt(continentvalues.size()));
     }

     if (!selectedContinent?.trim()) {
          resultMessage = "No continent selected";
          testcase.setPropertyValue("SELECTEDCONTINENT","");
          testcase.setPropertyValue("SELECTEDCOUNTRYISOCODE","");
          testRunner.gotoStepByName("showOutcome")
     } else {
          // Store the answer in a test case property
          resultMessage = "${selectedContinent}: ${continentcodes.get(continentvalues.indexOf(selectedContinent))}";
          testcase.setPropertyValue("SELECTEDCONTINENT",continentcodes.get(continentvalues.indexOf(selectedContinent)));
     }
  } else if (listOfContinentsByCodeResponseHdrCt.startsWith("EMPTY")) {
  	resultMessage = "No response received!!";
  } else {
  	resultMessage = "Response is not an xml, unable to process.";
  }
} catch(SAXException SAXex){
	resultMessage = "Unable to process response message: "+SAXex.getMessage();
} catch(NullPointerException NPex) {
	resultMessage = "No response found: "+NPex.getMessage();
} catch(Exception ex) {
    resultMessage = "Unable to process response message: "+ex.getMessage();
} finally {
	//UISupport.showInfoMessage(resultMessage);
	log.info("Result message continent: ${resultMessage}");
}

return;

import com.eviware.soapui.support.UISupport;
import groovy.util.slurpersupport.GPathResult;
import org.xml.sax.*;
import com.eviware.soapui.support.types.*;
import com.eviware.soapui.model.testsuite.*;

int currentStepInd = context.currentStepIndex;
TestCase testcase = testRunner.testCase;
TestStep listOfCountryByContinentStep = testcase.getTestStepAt(currentStepInd - 1);
Random randomCountry = new Random();

String resultMessage = '';

try{
  String listOfCountryByContinentResponseHdrCt = listOfCountryByContinentStep.testRequest.getResponse().getContentType();

  if (listOfCountryByContinentResponseHdrCt.contains("xml")) {
  	String listOfCountryByContinentStepResponse = listOfCountryByContinentStep.testRequest.getResponse().getContentAsXml();

     GPathResult XMLPResponseEnv = new groovy.util.XmlSlurper().parseText(listOfCountryByContinentStepResponse);

  	XMLPResponseEnv.declareNamespace(soap: 'http://schemas.xmlsoap.org/wsdl/soap/')
  	               .declareNamespace(soapenv: 'http://www.w3.org/2003/05/soap-envelope')
  	               .declareNamespace(websamci: 'http://www.oorsprong.org/websamples.countryinfo');

     List<String> countrycodes = new ArrayList<String>();
     List<String> countryvalues = new ArrayList<String>();

     // Get all countries for the specified continent
     XMLPResponseEnv.'soapenv:Body'.'websamci:ListOfCountryNamesGroupedByContinentResponse'.'websamci:ListOfCountryNamesGroupedByContinentResult'.'websamci:tCountryCodeAndNameGroupedByContinent'.each{
     	if (testcase.getPropertyValue("SELECTEDCONTINENT").equals(it.'websamci:Continent'.'websamci:sCode'.text())){
     		GPathResult XMLContinentCountries = it.'websamci:CountryCodeAndNames';
     		XMLContinentCountries.'websamci:tCountryCodeAndName'.each{
     			countrycodes.add(it.'websamci:sISOCode'.text());
     			countryvalues.add(it.'websamci:sName'.text());
     		};
     	};
     };

     def selectedCountry;

     // The LoadTestRunner indicates if the testcase is run during a load test.
     if (context.LoadTestRunner == null) {
     	// Ask the question
     	selectedCountry = UISupport.prompt("Select country", "Country", countryvalues);
     } else {
     	// Randomly get a country value from the result
     	selectedCountry = countryvalues.get(randomCountry.nextInt(countryvalues.size()));
     };

     if (!selectedCountry?.trim()) {
          resultMessage = "No country selected";
     } else {
          // The answer
          resultMessage = "${selectedCountry}: ${countrycodes.get(countryvalues.indexOf(selectedCountry))}";
          testcase.setPropertyValue("SELECTEDCOUNTRYISOCODE",countrycodes.get(countryvalues.indexOf(selectedCountry)));
     };
  } else if (listOfCountryByContinentResponseHdrCt.startsWith("EMPTY")) {
  	resultMessage = "No response received!!";
  } else {
  	resultMessage = "Response is not an xml, unable to process.";
  };
} catch(SAXException SAXex){
	resultMessage = "Unable to process response message: "+SAXex.getMessage();
} catch(NullPointerException NPex) {
	resultMessage = "No response found: "+NPex.getMessage();
} catch(Exception ex) {
    resultMessage = "Unable to process response message: "+ex.getMessage();
} finally {
	//UISupport.showInfoMessage(resultMessage);
	log.info("Result message country: ${resultMessage}");
}

return;

import com.eviware.soapui.support.UISupport;
import groovy.util.slurpersupport.GPathResult;
import org.xml.sax.*;
import com.eviware.soapui.support.types.*;
import com.eviware.soapui.model.testsuite.*;
import java.awt.Dimension;

int currentStepInd = context.currentStepIndex;
TestCase testcase = testRunner.testCase;
TestStep getFullCountryInfoStep = testcase.getTestStepAt(currentStepInd - 1);

String messageDescription = "Continent/Country Webservice information";
String messageTitle = '';
String messageText = '';

String FullCountryInfoResponseHdrCt = '';

String countryISOCode = '';
String countryName = '';
String countryCapitalCity = '';
String countryPhoneCode = '';
String countryContinentCode = '';
String countryCurrencyCode = '';
String countryFlag = '';
String countryLanguages = '';
Dimension screenDim = new Dimension();

Boolean confirmOrCancelOutcome;
String repeatTestCase = 'N';


try {  
  screenDim.setSize(800,200);
  if ( "".equals(testcase.getPropertyValue("SELECTEDCONTINENT")) || "".equals(testcase.getPropertyValue("SELECTEDCOUNTRYISOCODE")) ) {
  	log.info('Nothing choosen!!');
  	messageTitle = "Rerun";
  	messageText = "No continent/country has been choosen. Do you want to rerun the test case?";
  } else {
  	FullCountryInfoResponseHdrCt = getFullCountryInfoStep.testRequest.getResponse().getContentType();

  	if (FullCountryInfoResponseHdrCt.contains("xml")) {
  	   String FullCountryInfoResponse = getFullCountryInfoStep.testRequest.getResponse().getContentAsXml();

        GPathResult XMLPResponseEnv = new groovy.util.XmlSlurper().parseText(FullCountryInfoResponse);

  	   XMLPResponseEnv.declareNamespace(soap: 'http://schemas.xmlsoap.org/wsdl/soap/')
  	               .declareNamespace(soapenv: 'http://www.w3.org/2003/05/soap-envelope')
  	               .declareNamespace(websamci: 'http://www.oorsprong.org/websamples.countryinfo');

        // Get Data out of the result
        countryISOCode = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sISOCode'.text();
        countryName = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sName'.text();
        countryCapitalCity = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sCapitalCity'.text();
        countryPhoneCode = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sPhoneCode'.text();
        countryContinentCode = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sContinentCode'.text();
        countryCurrencyCode = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sCurrencyISOCode'.text();
        countryFlag = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:sCountryFlag'.text();
        countryLanguage = XMLPResponseEnv.'soapenv:Body'.'websamci:FullCountryInfoResponse'.'websamci:FullCountryInfoResult'.'websamci:Languages'.'websamci:tLanguage'.'websamci:sName'.text();

        // Building country outcome screen
        messageTitle = countryContinentCode+" - "+countryName;
        String liststyle = '"list-style-type:disc;"';
        messageText = "<html><body><div><ul style=${liststyle}><li>Capital: ${countryCapitalCity}</li><li>Language: ${countryLanguage}</li><li>Phone Area: ${countryPhoneCode}</li><li>Currency: ${countryCurrencyCode}</li></ul><br><img src='${countryFlag}' width='200' height='90' alt='${countryISOCode}'/></div></body></html>";
        screenDim.setSize(800,380);
  	} else if (listOfCountryByContinentResponseHdrCt.startsWith("EMPTY")) {
  	  messageText = "No response received!!";
     } else {
  	  messageText = "Response is not an xml, unable to process.";
     }
  };
} catch(SAXException SAXex){
	messageText = "Unable to process response message: "+SAXex.getMessage();
} catch(NullPointerException NPex) {
	messageText = "No response found: "+NPex.getMessage();
} catch(Exception ex) {
    messageText = "Unable to process response message: "+ex.getMessage();
} finally {
	// When running during a Load Test we don't repeat the testrunner
	if (context.LoadTestRunner == null){
		confirmOrCancelOutcome = UISupport.confirmExtendedInfo(messageTitle,messageDescription,messageText,screenDim);

		if (confirmOrCancelOutcome){
			// Here the OK-Button has been pressed
		     repeatTestCase = 'Y';
		     log.info('Repeating the test case!');
		     testRunner.gotoStepByName("prepareContinents");
	     } else {
		     // Here the CANCEL-Button has been pressed
		     repeatTestCase = 'N';
		     log.info('Stopping the test csse.');
	     };
	     testcase.setPropertyValue("REPEATTESTCASE",repeatTestCase);
     };
};

return;

